En la l√≠nea `if (condici√≥n)`, se eval√∫a una expresi√≥n booleana. Si la condici√≥n es verdadera, se ejecuta el c√≥digo dentro del bloque `{}`. Si la condici√≥n es falsa, se salta al siguiente bloque de c√≥digo.

Por ejemplo, aqu√≠ hay un ejemplo de c√≥digo que comprueba si un n√∫mero es par o impar:

