En este ejemplo, se comprueba si el resto de la divisi√≥n entre el n√∫mero y 2 es 0 (es decir, si el n√∫mero es par). Si es as√≠, se imprime "El n√∫mero es par." en la consola. Si no, se imprime "El n√∫mero es impar.".

Tambi√©n es posible combinar varias condiciones en un "if" utilizando operadores l√≥gicos como `&&` (y) y `||` (o). Por ejemplo:

